<head>

    <title>Boring</title>
    <style> 
    body{
        background-color:#DEFCF9;
    }
    p{
        font-size: 30pt;
    }
    .a{
        background-color:#EDCDBB;
        margin-bottom: 10px;
        text-align: center;
        
    }
    .b{
        display:flex;
        border-radius:15px;
        display:inline-block;
        margin-bottom:20px;   
        margin-right:20px;  
        text-align:center;       
    }
   .c{
        display:flex;
        flex-direction: row-reverse;
        margin-bottom:40px;        
    }
    .f{
        background-color: #EDCDBB;
        color:black;
        text-align: center;
        height: 40px;
        
    }
    .z{
        background-color:#EDCDBB;
        border:5px solid transparent;
        border-radius:20px;
        display:inline-block;
        margin-right:20px;
        margin-right: 20px;
        text-align:center;
        box-shadow:20px 20px 20px rgba(0, 0, 0, 0.8);

    }
    .z:hover{
        background-color:#F2B6A0;
        
        
    }

    img{
        height: 240px;
        width: 300px;
        background-color: transparent;
        cursor:pointer;
        
    }
    img:hover{
        height:250px;
        width: 310px;
        
    }
    ::-webkit-scrollbar{
        background-color:#DEFCF9 ;
    }
    ::-webkit-scrollbar-thumb{
        background-color:#DEFCF9;
        border-radius:10px;
    }
    ::-webkit-scrollbar-thumb:hover{
        background-color:#EDCDBB;
    }
    @media screen and (max-width:1000px){
        .b, .c{
                flex-wrap:wrap;
                margin-left:0px;
                margin-right:0px;
        }

        img{
            width:200px;
            height:200px;
        }

        .border{
            margin-bottom:20px;
        }
    }
  
    </style>
